(8726, 6696, 1026, 2, '02.愛你的幸福', '曲風：有活力的輕搖滾，帶點甜蜜的感覺~', '2008-10-25 00:00:00', 0000, 10, 0, 4, '愛你的幸福\r\n\r\n我喜歡  每個早晨被你吻醒\r\n張開眼  看你笑的彎彎眼睛\r\n吃你為我準備的愛心\r\n空氣充滿甜蜜\r\n\r\n我喜歡  時時有你溫馨簡訊\r\n一封封  肉麻噁心到我心底\r\n就算你沒有在我的身旁\r\n愛卻如影隨形\r\n\r\n抱著你一顆兩顆數星星\r\n直到天亮陽光刺眼睛\r\n美麗的夢不願意醒\r\n享受幸福的甜蜜空氣\r\n\r\n我想牽著你到處去旅行\r\n飛到你最愛的浪漫巴黎\r\n再飛去熱帶的夏威夷\r\n還有瑞士濃情巧克力\r\n\r\n也許你會覺得我委屈\r\n一直遷就你\r\n可是我真的真的不委屈\r\n因謂愛你我也開心', '', 224, '', '詠詠', '詠詠', '詠詠', '', '', 0, 1, 0, '2008-10-25 15:16:51', '2015-03-12 13:34:46', '0000-00-00 00:00:00'),
