(8742, 146, 0, 1, '一起加油吧！', '這是全世界的續集，情歌就是報復無情的最好手段！', '0000-00-00 00:00:00', 0000, 20, 0, 7, '沒有你的溫柔 我怎麼會知道 我也可以很重要\r\n沒有你的膽小 我怎麼會知道 馬路上不適合擁抱\r\n沒有你的眼淚 我怎麼會知道 我的體貼愈來愈少\r\n沒有過那麼久 我怎麼會知道 你真的比較喜歡睡覺\r\n\r\n仍然想要為你唱一首歌\r\n仍然想要在冬天裡擁抱\r\n仍然想要偷看你的微笑\r\n仍然想要你感覺到\r\n\r\n沒有我的無聊 你怎麼會知道 你是多麼喜歡笑\r\n沒有我的情緒 你怎麼會知道 有些問題我解決不了\r\n沒有我的反覆 你怎麼會知道 我的任性和煩惱\r\n沒有過那麼久 你怎麼會知道 在一起就是一起變老\r\n\r\n仍然想要為你唱一首歌\r\n仍然想要在冬天裡擁抱\r\n仍然想要偷看你的微笑\r\n仍然想要你感覺到\r\n\r\n我的愛 那麼少 親愛的 全部給你 一起加油吧\r\n\r\n', '', 299, '', '鄭焙隆', '鄭焙隆', '', '', '', 0, 0, 0, '2008-10-26 23:26:26', '2015-03-12 13:34:46', '0000-00-00 00:00:00'),
