(8854, 6768, 0, 1, '準備好，跳!(Ready Steady Rock!)', '吵鬧的碎拍跳舞音樂，不吵不要錢。\r\n這首歌的靈感來自於2005年，我每個星期五，站在舞池裡五個小時所得到的。', '0000-00-00 00:00:00', 0000, 0, 1, 7, '而我在找尋，屬於我的Groove\r\n站在舞池裡，能夠讓你Move\r\n而我在找尋，屬於我的Groove\r\n站在舞池裡，能讓你跳舞', '', 357, '', '百樂K', '百樂K', '百樂K', '無', '', 0, 1, 0, '2008-10-27 21:35:59', '2015-03-12 13:34:50', '0000-00-00 00:00:00'),
(8855, 6768, 0, 2, '堅持', '這絕對是一首立志的歌曲，寫給自己，也寫給需要鼓勵的音樂創作人，大家一起加油！堅持下去啊!!!', '2010-02-12 00:00:00', 0000, 0, 1, 7, '還在思考我的人生要如何再向前\r\n我想重回那些我曾經做過的一切\r\n時間他偷偷流失\r\n回憶卻不夠充實\r\n每天起床我總是看著鏡子裡的臉\r\n曾幾何時我也一點一滴慢慢在改變\r\n不想要變的自私\r\n我需要繼續堅持\r\n\r\n實現夢想這條路上如何保持信念\r\n不希望未來回頭看自己是空白一片\r\n時間他偷偷流失\r\n回憶卻不夠充實\r\n每天起床我總是看著鏡子裡的臉\r\n曾幾何時我也一點一滴慢慢在改變\r\n不想要變的自私\r\n哦我要堅持\r\n\r\n站在高處往下看\r\n經過漫長的等待\r\n這些日子忍受多少無奈和無數期待\r\n想像自己的未來\r\n像天空一樣蔚藍\r\n我要展開翅膀遨翔\r\n閃爍著屬於自己的光芒\r\n\r\n我還有多少力量\r\n來假裝我很堅強\r\n偷一點陽光緊緊握在我手上\r\n我還有什麼希望\r\n來支持我的棟樑\r\n當我發現我的手\r\n已經發燙像太陽\r\n', '', 214, '', '百樂K', '百樂K', '百樂K', '無', '', 0, 1, 0, '2008-10-27 21:43:50', '2015-03-12 13:34:51', '0000-00-00 00:00:00'),
(8856, 6768, 0, 1, '雲煙', '如果可以把天空的雲當成煙抽，海裡的水當啤酒喝，那人類社會應該會更和平一些。(歌詞有唱錯發音的部分，請見諒!)', '0000-00-00 00:00:00', 0000, 0, 1, 7, '不用說我也自己也能發現\r\n你和他們之間存在許多的謊言\r\n我和你經不起太多考驗\r\n已結下的心結再也不能去改變\r\n\r\n要決擇把感情放一邊\r\n我一定要親眼把繁星連成線\r\n不自覺我來到了背面\r\n趁天沒黑之前再重新考慮一遍 閉上眼\r\n\r\n碰撞 再擦肩 我不後悔而你相差的太遠\r\n誤會 再毀滅 過往雲煙 海天早連成一線\r\n碰撞 再擦肩 我不後悔而你相差的太遠\r\n誤會 再毀滅 過往雲煙兒  回憶只是曇(ㄊㄢ二聲)花一現\r\n\r\nrepeat\r\n\r\n如何閉上雙眼 再感覺\r\n如何進入照片 再體驗\r\n如何擺脫感覺 我是誰\r\n要把你的溫柔寫進我的詩篇\r\n', '', 254, '', '百樂k', '百樂k', '百樂k', '無', '', 0, 1, 0, '2008-10-27 21:48:42', '2015-03-12 13:34:51', '0000-00-00 00:00:00'),
(8857, 6768, 0, 2, '角度', '鹹濕鹹濕，我愛夜店妹!一起脫光看動物星球頻道!', '2012-02-13 00:00:00', 0000, 0, 1, 7, '你看到我就微笑\r\n貼過來對我撒嬌\r\n感覺你就像是隻野貓\r\n我脫掉我的外套\r\n也解開你的胸罩\r\n一起來收看動物頻道\r\n\r\n我們撐不過今晚\r\n我就是要現在\r\n我們不能再等待\r\n想要現在就來\r\n\r\n注意聽好現在要開始嗨\r\n我的朋友全部站出來\r\n跟著碎拍一起搖一起擺\r\n跟著一起擺一起搖的碎拍\r\n我很清楚自己的未來\r\n也很清楚自己過的精采\r\n如果要發呆 如果要無奈\r\n跟著音樂一起跳起來\r\n\r\n嗚 我喜歡這樣的角度\r\n可以看的一清二楚\r\n讓我們混亂的結束\r\n再一起瘋狂的跳舞\r\n\r\n有些人你甩不掉\r\n一夜之後他還要\r\n感覺他就像是隻野豹\r\n\r\n我們撐不過今晚\r\n我就是要現在\r\n我們不能再等待\r\n想要現在就來\r\n\r\n嗚 我喜歡這樣的角度\r\n可以看的一清二楚\r\n讓我們混亂的結束\r\n再一起瘋狂的跳舞\r\nRepeat\r\n', '', 218, '', '百樂K', '百樂K', '百樂K', '無', '', 0, 0, 0, '2008-10-27 21:57:04', '2015-03-12 13:34:51', '0000-00-00 00:00:00'),
(8858, 6768, 0, 1, '窗外的天空', '如果台北人打開窗聽到的，不是公車的開門氣壓聲、計程車的喇叭聲、機車的排氣管聲或是人類大聲交談的聲音，那世界該會多美好。', '0000-00-00 00:00:00', 0000, 0, 1, 7, '', '', 130, '', '百樂K', '百樂K', '百樂K', '無', '', 0, 1, 0, '2008-10-27 22:13:03', '2015-03-12 13:34:51', '0000-00-00 00:00:00'),
